import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Signup from './pages/Signup';
import Login from './pages/Login';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home'; // main page after login
import MajorsList from './pages/MajorsList';
import MajorDetail from './pages/MajorDetail';
import Profile from './pages/Profile';

function App() {
  return (
    <div className="app">
      <Navbar />
      <div className="container">
        <Routes>
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/home" element={<Home />} /> {/* main page after login */}
          <Route path="/majors" element={<MajorsList />} />
          <Route path="/majors/:id" element={<MajorDetail />} />
          <Route path="/profile" element={<Profile />} />
        </Routes>
      </div>
      <Footer />
    </div>
  );
}

export default App;
